INSERT INTO `trailer_rent` VALUES (1,'Аренда автоприцепа с тентом','В концепцию прицепа был заложен крепкий кузов уникальных размеров 3 на 1,5 метра. На легковом прицепе \"Атлет\" удобно перевозить\nкак материалы для строительства, так и технику для экстримального отдыха. Высота кузова от пола до тента 1,5 метра.','arenda-s-tentom','https://api.zhbl.by/trailers/preview-with-tent.png','ZHBL - Аренда автоприцепов с тентом (Минск)','',''),(2,'Аренда автоприцепа без тента','В концепцию прицепа был заложен крепкий кузов уникальных размеров 3 на 1,5 метра. Прицеп Титан-3000 для легковых\nавтомобилей решает вопрос перевозки тяжёлых (до 500 кг) и габаритных грузов, когда нет возможности или потребности в покупке грузового транспорта.\nОборудован высоким жёстким каркасом, к которому можно крепить грузы для их большей устойчивости.','arenda-bez-tenta','https://api.zhbl.by/trailers/preview-without-tent.jpg','ZHBL - Аренда автоприцепов без тента (Минск)','','');
/*!40000 ALTER TABLE `trailer_rent` ENABLE KEYS */;
